import React from "react";
import "./App.css";
import MainLayout from "./layouts/MainLayout/MainLayout.tsx";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a>Learn React</a>
        <MainLayout />
      </header>
    </div>
  );
}

export default App;
